import "./App.css";
import NavBar from "./Component/NavBar";
import Product from "./Component/Product";

function App() {
 const products = [1, 2, 3, 4, 5, 6]; // This could be an array of product data

  return (
    <div className="App">
      <NavBar />
      <Container>
        <Row>
          {products.map((product, index) => (
            <Col key={index} xs={12} md={4} lg={3}>
              <Product />
            </Col>
          ))}
        </Row>
      </Container>
    </div>
  );
}

export default App;
